import React, { Fragment, useEffect, useState } from "react";
import Button from '@mui/material/Button';
import { fetchHome } from "../apis/home";
import { SignUpDialog } from "../components/SignUpDialog"
import { LogInDialog } from "../components/LogInDialog"

export const Home = (props) => {

  const [openSignupDialog, setOpenSignupDialog] = useState(false)
  const [openLoginDialog, setOpenLoginDialog] = useState(false)

  // 新規登録のDialogを開くCallback関数
  const handleClickOpenSignUp = () => {
    setOpenSignupDialog({ signUpDialog: true }, [setOpen])
  }

  // ログインのDialogを開くCallback関数
  const handleClickOpenLogIn = () => {
    setOpenLoginDialog({ logInDialog: true })
  }

  // 新規登録のDialogを閉じるCallback関数
  const handleCloseSignUp = () => {
    setOpenSignupDialog({ signUpDialog: false })
  }

  // ログインのDialogを閉じるCallback関数
  const handleCloseLogIn = () => {
    setOpenLoginDialog({ logInDialog: false })
  }

  //Homeの更新？
  useEffect(() => {
    fetchHome()
      .then((data) =>
        console.log(data)
      )
  }, [])

  return (
    <Fragment>
      <h1>HOME画面</h1>

      <Button variant="outlined" onClick={handleClickOpenSignUp}>
        新規登録
        <SignUpDialog open={openSignupDialog} handleClose={handleCloseSignUp} handleLogin={props.handleLogin} />
      </Button>

      <Button variant="outlined" onClick={handleClickOpenLogIn}>
        ログイン
        <LogInDialog open={openLoginDialog} handleClose={handleCloseLogIn} handleLogin={props.handleLogin} />
      </Button>

    </Fragment>
  )
}
